            {createdQuizzes && createdQuizzes.map((quiz, idx) => {
                const url = `${webHost}/quizzes/${quiz.id}`;

                return <QuizPreview key={idx} url={url} quiz={quiz} deleteQuiz={deleteQuiz} />
